def generateImages():
    print('a')
    if not os.path.exists("images"):
        os.makedirs('images')
        os.makedirs('images/materials')

    for keys, values in code.items():
        if keys != 'clouds.png' or keys != 'paper.png' or keys != 'water.png' or keys != 'wood.png' or keys != 'glass.png':
            dir = 'images/'
        if keys == 'clouds.png' or keys == 'paper.png' or keys == 'water.png' or keys == 'wood.png' or keys == 'glass.png':
            dir = 'images/materials/'
        if not os.path.exists(f'{dir}{keys}'):
            code_to_image(values, f'{dir}{keys}')

